import Typography from '@mui/material/Typography';

const ItemListContainer = ({greetings}) => 
    <Typography
            variant="h6"
            noWrap
            component="a"
            href="/"
            sx={{
              display: { xs: 'none', md: 'flex' },
              fontFamily: 'monospace',
              fontWeight: 700,
              letterSpacing: '.3rem',
              color: 'inherit',
              textDecoration: 'none',
            }}
            align='justify'

    >
        {greetings}
    </Typography>





export default ItemListContainer;
